import React, { Component } from 'react';
import {Nav,Table,Card,Row}from 'react-bootstrap';
import '../../App.css';
/*
const StudentProfile = () => {

}
*/

class StudentProfile extends Component {
    //
    constructor(props) {
      super()
      this.state = {student: sessionStorage.getItem('student') }
    }

    render() {
        return (
          <React.Fragment>
              <Row>
      
                <Card style={{border:"none" }}>

                  <Card.Body style={{border:"none", top:'70px',bottom:'10px',width: '600px'}}>
                    <h5>{this.state.student.firstname} {this.state.student.lastName}</h5>
                    {this.state.student.location}<br/>
                          May20,1990<br/>
                          joc.mac@gmail.com<br/>
                          School Program   
                  </Card.Body>
                </Card>            
                
              </Row> 

            <h5>Tutoring Session Request</h5>
  </React.Fragment>

        );
    }
}

export default StudentProfile;
